import React from 'react';
import './App.css';
import './App.scss';
//import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom' 
import logo0 from './images/pands.png';
//import Header from './components/header';
import { Route, Link, BrowserRouter as Router, Switch } from 'react-router-dom'
import About from './components/About/About';
import Catalog from './components/Catalog/Catalog';
import Contact from './components/Contact/Contact';
import Offer from './components/Offer/Offer';
import Orders from './components/Orders/Orders';
import ShopService from './components/ShopService/Services';
import Notfound from './components/Notfound/Notfound';

const routing = (
    <Router>
        <div>
            <ul>
                <li>
                    <Link to="/">Strona główna</Link>
                </li>
                <li>
                    <Link to="/about">Firma</Link>
                </li>
                <li>
                    <Link to="/offer">Oferta</Link>
                </li>
                <li>
                    <Link to="/service">Usługi</Link>
                </li>
                <li>
                    <Link to="/catalog">Katalog</Link>
                </li>
                <li>
                    <Link to="/orders">Zamówienia</Link>
                </li>
                <li>
                    <Link to="/contact">Kontakt</Link>
                </li>
            </ul>

            <Switch>

                <Route path="/about" component={About}/>
                <Route path="/catalog" component={Catalog}/>
                <Route path="/contact" component={Contact}/>
                <Route path="/offer" component={Offer}/>
                <Route path="/orders" component={Orders}/>
                <Route path="/service" component={ShopService}/>
                <Route component={Notfound}/>
            </Switch>
        </div>
    </Router>
)

function App() {

  let Main = (
    <h2>MAINs</h2>
  )

  let About = (
    <h2>About</h2>
  )

  let header = (
    <div className="Banner">
        <img className="Logo" src={logo0}></img>
        <div className="Navbar">
          {routing}
        </div>
        <div className="Test">
            <p>Zaloguj</p>
        </div>
    </div>
  );

  return (
    <div className="App">
      {header}
    </div>
  );
}

export default App;
